(window.webpackJsonp=window.webpackJsonp||[]).push([[418],{772:function(n,h,t){"use strict";t.r(h);var g=t(44),i=Object(g.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1353-giet-chet-nha"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1353-giet-chet-nha"}},[n._v("#")]),n._v(" Chương 1353: Giết chết nha!")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1353: Giết chết nha!"),t("br"),t("br"),n._v("Lúc trước học qua Thiên Long Bát Âm, chỉ cần không có đạt tới Chân Long cấp bậc, hơn nữa trong cơ thể nắm giữ Long tộc huyết mạch Thánh thú, liền có thể tuỳ tiện áp bức, không có lực lượng phản kháng."),t("br"),t("br"),n._v("Vốn cho rằng đầu này đại gia hỏa, là Thánh vực bát trọng, rống một tiếng hẳn là tác dụng không quá lớn, không thành công, bản thân lại lực lượng tiêu hao quá lớn, chỉ có thể mặc cho người xâm lược, cho nên, không dám tùy tiện động thủ, nằm mơ đều không có nghĩ đến, hai chữ này uy lực vẫn như cũ mạnh như vậy!"),t("br"),t("br"),n._v("Sớm biết như vậy, vừa thấy mặt liền hô, cũng không trở thành bị động như vậy, suýt chút nữa bị tại chỗ đánh chết."),t("br"),t("br"),n._v("“Ngươi là... Chân Long?”"),t("br"),t("br"),n._v("Hắn bên này cảm khái, nằm trên mặt đất, không ngừng co giật Địa Ngục Thanh Long thú, lần nữa nhìn qua, con mắt thật to bên trong, lộ ra nồng đậm hoảng sợ."),t("br"),t("br"),n._v("Long tộc huyết mạch đẳng cấp sâm nghiêm, nó cứ việc mệnh danh Thanh Long thú, nhưng là cùng chân chính long tộc, vẫn là có rất lớn chênh lệch, đối phương có khả năng hô lên tinh thuần như vậy Thiên Long Bát Âm, tất nhiên nắm giữ so với nó còn tinh khiết hơn Long tộc huyết mạch."),t("br"),t("br"),n._v("“Ta mặc dù không phải Chân Long, nhưng chỉ cần thần phục ta, có thể để cho huyết mạch của ngươi trở nên càng thêm tinh thuần, thực lực mạnh hơn!”"),t("br"),t("br"),n._v("Trương Huyền đi tới, xem ra đối phương chỉ cần không đồng ý, liền sẽ tiếp tục thi triển Thiên Long Bát Âm, đem hắn đánh chết tươi."),t("br"),t("br"),n._v("“Ta thần phục...”"),t("br"),t("br"),n._v("Không chần chờ quá lâu, Thanh Long thú cúi đầu xuống."),t("br"),t("br"),n._v("Có khả năng nói ra Thiên Long Bát Âm, coi như không phải Chân Long, cũng tất nhiên cùng hắn liên quan đến, huyết mạch áp chế, thần phục chẳng những không cảm thấy ném thú, còn mười phần may mắn."),t("br"),t("br"),n._v("Loại cơ hội này không nắm chặt lại, mới là thật ngu."),t("br"),t("br"),n._v("Thấy nó đồng ý, Trương Huyền thở phào nhẹ nhõm."),t("br"),t("br"),n._v("Vốn là giúp Lạc Huyền Thanh tìm kiếm Động Hư hồ lô, nằm mơ đều không có nghĩ đến, thu cái Thánh vực bát trọng Thánh thú... Bất quá, như vậy cũng tốt, về sau tại Thánh tử điện, hoàn toàn có thể xông pha, học viên bên trong, có thể thắng được đầu này đại gia hỏa, hầu như không có."),t("br"),t("br"),n._v("..."),t("br"),t("br"),n._v("Trong sơn động, Viên Hiểu thận trọng chậm chạp tiến lên."),t("br"),t("br"),n._v("Trong này, nắm giữ Thánh vực bát trọng Thánh thú, hắn không dám phóng ra thần thức, cũng không dám phi hành, chỉ có thể dùng mắt thường một chút xíu tìm kiếm... Chỉ bất quá hang núi thực sự quá lớn, cái này đều đi qua hơn mười phút, còn chưa đi xong một lần."),t("br"),t("br"),n._v("“Tại sao không có?”"),t("br"),t("br"),n._v("Lại đi một hồi, lần nữa trở lại cửa động vị trí, mày nhăn lại."),t("br"),t("br"),n._v("Như vậy một vòng lớn, đem trọn sơn động đều xoay một lần, làm sao lại liền Thanh Long thú cái bóng cũng không thấy? Chẳng lẽ, ra ngoài kiếm ăn, chưa có trở về?"),t("br"),t("br"),n._v("Thật muốn như vậy cũng quá xong rồi, hoàn toàn có thể tại ngoài động sắp đặt cái trận pháp, đối phương một khi trở về, phát động đồng thời đem hắn vây khốn, cũng sẽ không cần hắn mạo hiểm đi hấp dẫn."),t("br"),t("br"),n._v("“Nhanh đem chuyện này nói cho Lạc Huyền Thanh bọn họ...”"),t("br"),t("br"),n._v("Thả ra thần thức, quét một lần, quả nhiên không có phát hiện, Viên Hiểu vội vã đi ra ngoài."),t("br"),t("br"),n._v("Chuyện này nhất định phải nhanh nói cho Lạc Huyền Thanh đám người, để hắn không cần chờ..."),t("br"),t("br"),n._v("Theo hang núi lần nữa gạt ra, đang muốn gọi Trương Huyền, chỉ thấy một đầu to lớn Thanh Long thú, nằm rạp trên mặt đất, một mặt nịnh nọt dùng đầu lưỡi liếm láp hắn ống quần."),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Con mắt một cái trợn tròn, Viên Hiểu giống như là giống như gặp quỷ: “Trương sư... Đây là có chuyện gì?”"),t("br"),t("br"),n._v("Hắn đều bối rối."),t("br"),t("br"),n._v("Đi hang núi tìm kiếm Địa Ngục Thanh Long thú, tìm một vòng đều không có tìm tới, ở bên ngoài nhìn thấy không nói, còn ghé vào Trương Huyền chân trước mặt liếm ống quần... Đến cùng xảy ra chuyện gì?"),t("br"),t("br"),n._v("“A, Thanh Long thú từ bên ngoài tới, cùng ta đụng tới, vừa vặn lúc rảnh rỗi, liền thuận tay thuần phục...”"),t("br"),t("br"),n._v("Trương Huyền giải thích."),t("br"),t("br"),n._v("“Thuận tay thuần phục...”"),t("br"),t("br"),n._v("Thân thể nhoáng một cái, Viên Hiểu thiếu chút nữa ngất đi."),t("br"),t("br"),n._v("Đây chính là Thánh vực bát trọng Thánh thú... Bọn họ gặp được đều có thể chạy bao xa chạy bao xa tồn tại, trực tiếp thuần phục... Lúc này mới bao lâu thời gian?"),t("br"),t("br"),n._v("Mười phút đồng hồ? Hai mươi phút?"),t("br"),t("br"),n._v("Dù sao khoảng cách nửa canh giờ, kém rất xa!"),t("br"),t("br"),n._v("Cố nén làm chuyện điên rồ biểu lộ, lần nữa nhìn qua: “Ngươi... Còn tinh thông thuần thú?”"),t("br"),t("br"),n._v("“Khảo hạch qua thuần thú sư!”"),t("br"),t("br"),n._v("Trương Huyền gật đầu."),t("br"),t("br"),n._v("Viên Hiểu nghẹn nói không ra lời."),t("br"),t("br"),n._v("Người này bày trận nhanh ngược lại cũng thôi, vẫn là cái luyện đan sư, y sư... Hiện tại thuần thú cũng lợi hại như vậy, còn có không biết ư?"),t("br"),t("br"),n._v("“Đi xem một chút Lạc huynh bọn họ đi!”"),t("br"),t("br"),n._v("Đem Thanh Long thú thuần phục, nguy hiểm giải trừ, tiếp tục đợi ở chỗ này, cũng không có cái gì ý nghĩa, Trương Huyền khoát tay áo."),t("br"),t("br"),n._v("Hắn tại bên ngoài sơn động chiến đấu, động tĩnh như thế lớn, Viên Hiểu đi vào trong động, không phóng ra thần thức, chung quanh còn có thể nắm giữ trận pháp, không thể nhận ra cảm giác ngược lại cũng thôi, Lạc Huyền Thanh đám người khoảng cách gần như vậy, cũng không nghe thấy, không có người tới, sẽ không phải đã xảy ra chuyện gì đi!"),t("br"),t("br"),n._v("Hai người hướng Lạc Huyền Thanh đám người vị trí đi đến."),t("br"),t("br"),n._v("Còn chưa tới đến trước mặt, liền cảm thấy từng cơn tiếng gió rít gào, thổi đến sơn cốc đá tảng lăn mình, tựa hồ sợ gây ra quá lớn động tĩnh, dẫn tới càng nhiều Thánh thú, hai bên tựa hồ cũng khắc chế lực lượng, kình khí chỉ ở trong phạm vi nhất định vận chuyển, không có chút nào tiết lộ."),t("br"),t("br"),n._v("Vòng qua nham thạch nhìn, chỉ thấy hai bóng người đang tại phía trước giao thủ, một chiêu một thức, mang theo uy lực cực kỳ mạnh, coi như hắn loại thực lực này, vừa ý một hồi, đều cảm thấy trong lòng run sợ, không dám trước mắt."),t("br"),t("br"),n._v("“Hắn liền là Trương Thuần?”"),t("br"),t("br"),n._v("Nhận ra chiến đấu một phương chính là Lạc Huyền Thanh, Trương Huyền hỏi."),t("br"),t("br"),n._v("Đối diện là cái chừng ba mươi tuổi thanh niên, lông mày đen nhánh, cánh tay thon dài, nhất cử nhất động, mang theo hỗn nhược thiên thành lực lượng, thực lực cùng Lạc Huyền Thanh giống nhau, đều là Thánh vực thất trọng đỉnh phong."),t("br"),t("br"),n._v("“Ừm!”"),t("br"),t("br"),n._v("Viên Hiểu gật đầu lên tiếng."),t("br"),t("br"),n._v("Trương Huyền nhìn kỹ lại."),t("br"),t("br"),n._v("Cùng lúc trước hắn nói đồng dạng, hai người chiến đấu, quả thực chiêu chiêu tàn nhẫn."),t("br"),t("br"),n._v("Chỉ bất quá, hai bên biết rõ cực sâu, mỗi một chiêu đều giống như là trước thời hạn biết, cứ việc hung hiểm, lại đều không cách nào làm bị thương đối phương chút nào."),t("br"),t("br"),n._v("Ngược lại bởi vì động tác quá nhanh, giống như là đồng môn sư huynh đệ, tại lặp đi lặp lại nhận chiêu."),t("br"),t("br"),n._v("Bích Hồng Âm, Vân Liên Hải hai người đối diện, thì đứng bốn người, từng cái hai tay ôm ở trước ngực, rất hứng thú nhìn lấy hai bên chiến đấu."),t("br"),t("br"),n._v("“Đánh như thế nào đi lên?”"),t("br"),n._v("Đi tới trước mặt, Viên Hiểu thấp giọng."),t("br"),t("br"),n._v("Không phải nói tới ngăn cản đối phương tiến lên, làm bộ dáng ư? Thế nào thật đánh nhau?"),t("br"),t("br"),n._v("“Chúng ta tới ngăn cản bọn họ, Trương Thuần nói lên dùng võ quyết thắng thua, người nào thắng, liền đi thuần phục Thanh Long thú, thua, trực tiếp cuốn xéo! Cho nên bọn họ liền đánh nhau, có điều, hai người thực lực tương đương, cũng đều lẫn nhau quen thuộc, đều thời gian dài như vậy, vẫn như cũ không có phân ra thắng bại!”"),t("br"),t("br"),n._v("Bích Hồng Âm giải thích một câu, nhíu nhíu mày: “Thế nào? Đầu kia Thanh Long thú đâu? Có hay không dẫn tới?”"),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Nhớ tới sự tình vừa rồi, Viên Hiểu không biết trả lời như thế nào, đành phải lắc đầu: “Ngươi vẫn là hỏi Trương sư đi!”"),t("br"),t("br"),n._v("Bích Hồng Âm có chút kỳ quái, có điều, vẫn là xoay đầu lại: “Trương sư, thế nào?”"),t("br"),t("br"),n._v("“A, mới vừa cùng Thanh Long thú đánh một hồi...”"),t("br"),t("br"),n._v("Nói một câu, Trương Huyền đang muốn giải thích vừa rồi chuyện phát sinh, liền cảm thấy phía trước sóng khí lăn mình, trên không Trương Thuần song chưởng bỗng nhiên đẩy một cái, thoát ly vòng chiến, ngay sau đó nhíu nhíu mày, một mặt khó tin nhìn về phía Trương Huyền hai người: “Các ngươi không có việc gì?”"),t("br"),t("br"),n._v("Thanh Long thú nổi giận đùng đùng đi tìm phiền toái, làm sao có thể hai người không bị thương chút nào trở về?"),t("br"),t("br"),n._v("“Có ý tứ gì?”"),t("br"),t("br"),n._v("Thấy hắn bộ biểu tình này, Lạc Huyền Thanh ý thức được không đúng, cũng nhìn lại."),t("br"),t("br"),n._v("“Huyền Thanh, người này tới đây trước đó, liền gặp Thanh Long thú, cố ý nói ngươi muốn thuần phục nó, kích thích đối phương nổi giận, chỉ cần chúng ta tiếp xúc, liền sẽ gặp phải công kích...”"),t("br"),t("br"),n._v("Viên Hiểu nói."),t("br"),t("br"),n._v("Tới thời điểm, Trương Huyền đem sự tình giải thích cặn kẽ một lần, đã biết, trúng thủ đoạn của đối phương."),t("br"),t("br"),n._v("“Không sai, ta là trước thời hạn gặp Thanh Long thú, ngươi vừa rồi cố ý ngăn cản ta, trên thực tế, ta cũng tại ngăn cản ngươi, muốn nhìn một chút, cuồng bạo Thanh Long thú, đến cùng có thể sinh ra bao nhiêu lực lượng...”"),t("br"),t("br"),n._v("Nhẹ nhàng cười một tiếng, Trương Thuần cũng không phủ nhận, tràn đầy nghi ngờ nhìn qua: “Hai người các ngươi, gặp được như vậy đại gia hỏa, làm sao lại không có việc gì? Tổn thương đều không có nhận?”"),t("br"),t("br"),n._v("Cũng khó trách hắn kỳ lạ."),t("br"),t("br"),n._v("Địa Ngục Thanh Long thú, Thánh vực bát trọng Thánh thú, trong cơn giận dữ, hắn đều chống lại không được, hai người kia không có việc gì, không bị thương chút nào đi về tới, căn bản không phù hợp đạo lý."),t("br"),t("br"),n._v("Dựa theo kế hoạch lúc trước của hắn, cố ý ngăn lại Lạc Huyền Thanh, không để cho cứu viện, như vậy trải qua, hắn hai vị đồng bọn, tất nhiên bị thương, làm không cẩn thận trực tiếp mất đi sức chiến đấu, đến lúc đó lại đem Thanh Long thú dẫn tới, không chỉ có thể thu hoạch được hảo cảm, còn để người sau chịu thiệt, nhất cử lưỡng tiện..."),t("br"),t("br"),n._v("Hai người liền như thế trở về, chẳng lẽ, không có gặp được?"),t("br"),t("br"),n._v("“Ngươi chính là Trương Thuần?”"),t("br"),t("br"),n._v("Lười nhác trả lời, Trương Huyền nhìn qua."),t("br"),t("br"),n._v("“Không sai, ngươi là ai?”"),t("br"),t("br"),n._v("Nhíu nhíu mày, Trương Thuần trên mặt không vui."),t("br"),t("br"),n._v("Một cái Xuất Khiếu cảnh đỉnh phong tiểu gia hỏa mà thôi, dám gọi thẳng tên của hắn, lá gan thật là không nhỏ."),t("br"),t("br"),n._v("“Không cần phải để ý đến ta là ai, ta nghe nói, ngươi đối Lạc gia tiểu công chúa, có ý nghĩ xấu?”"),t("br"),t("br"),n._v("Trương Huyền tiếp tục nói."),t("br"),t("br"),n._v("“Ngươi có ý tứ gì?” Híp mắt lại, Trương Thuần quay đầu nhìn về phía Lạc Huyền Thanh: “Lạc Huyền Thanh, đây là người của ngươi?”"),t("br"),t("br"),n._v("“Trương sư...”"),t("br"),t("br"),n._v("Nghe được nhắc muội muội của mình, Lạc Huyền Thanh cũng nhíu nhíu mày, nhịn không được nhìn qua."),t("br"),t("br"),n._v("“Lạc huynh, ngươi liền nói, hắn có phải hay không đối tiểu công chúa, có ý nghĩ xấu!”"),t("br"),t("br"),n._v("Cũng không nhiều lời, Trương Huyền nhìn lại."),t("br"),t("br"),n._v("“Hừ, con cóc muốn ăn thịt thiên nga, muội muội ta, há lại là hắn xứng được với!”"),t("br"),t("br"),n._v("Không biết Trương Huyền có ý tứ gì, nhưng nói chuyện đến muội muội, Lạc Huyền Thanh vẫn là hừ một tiếng, tràn đầy không vui."),t("br"),t("br"),n._v("Hắn vốn là đối Trương gia người khó chịu, người này còn dám quấy rối muội muội của hắn, nếu không phải tới thực lực tương đương, khẳng định đã sớm đánh đối phương cha ruột đều không nhận ra được."),t("br"),t("br"),n._v("“Đã Lạc huynh nói như vậy, cái kia đánh hắn một trận cũng không xử oan!”"),t("br"),t("br"),n._v("Trương Huyền gật đầu."),t("br"),t("br"),n._v("“Đánh ta? Chỉ bằng ngươi?”"),t("br"),t("br"),n._v("Còn tưởng rằng cái này đột nhiên xuất hiện gia hỏa, muốn làm gì, nghe được muốn đánh hắn, Trương Thuần giận quá mà cười."),t("br"),t("br"),n._v("Hắn Thánh tử trong điện viện cường giả đỉnh phong, Thánh Nhân Trương gia tuyệt thế thiên tài, ai thấy không dọa đến run rẩy?"),t("br"),t("br"),n._v("Một cái Xuất Khiếu cảnh đỉnh phong tiểu gia hỏa, thế mà ăn nói ngông cuồng... Quả thực xem hắn tại không có gì!"),t("br"),t("br"),n._v("“Trương sư...”"),t("br"),t("br"),n._v("Lạc Huyền Thanh cũng không hiểu ra sao."),t("br"),t("br"),n._v("Vị này Trương Huyền có phải hay không mới vừa bị người đánh ngu?"),t("br"),t("br"),n._v("Đây chính là Trương Thuần, liền hắn muốn vượt qua cũng khó khăn... Ngươi muốn đánh hắn?"),t("br"),t("br"),n._v("“Không sai!” Trương Huyền gật đầu."),t("br"),t("br"),n._v("“Vậy thì tốt, để cho ta nhìn một chút, đến cùng có dạng gì thực lực, dám càn rỡ như thế...”"),t("br"),t("br"),n._v("Cười lạnh một tiếng, Trương Thuần bàn tay lăng không một trảo, nhất thời một cỗ cường đại tới cực điểm lực lượng, đối Trương Huyền liền bao phủ mà tới."),t("br"),t("br"),n._v("“Giết chết nha!”"),t("br"),t("br"),n._v("Đứng tại chỗ không nhúc nhích, Trương Huyền vỗ tay phát ra tiếng."),t("br"),t("br"),n._v("Rống!"),t("br"),t("br"),n._v("Thanh âm còn không có kết thúc, một đầu dài đến hơn ba mươi mét Thanh Long thú liền bất ngờ xuất hiện ở trước mặt mọi người, thô to đuôi, đột nhiên quét qua."),t("br"),t("br"),n._v("Bành!"),t("br"),t("br"),n._v("Còn không có kịp phản ứng, Trương Thuần liền bay ngược ra ngoài, một đầu đâm vào trong lòng núi, đập ra một cái to lớn cái hố."),t("br"),t("br"),n._v("(Cảm ơn thư hữu  mười vạn khen thưởng, trở thành quyển sách thứ 67 vị minh chủ. Mặt khác, tiến cử đại thần trường phong tác phẩm 《 sau đó 》, phi phi phi phi, là 《 phía sau màn 》, ưa thích chiến tranh tình báo có thể đi nhìn, quyển sách này đã chuẩn bị đập kịch truyền hình, đến lúc đó có thể cho nữ hoặc là bạn trai, lão công kịch thấu. Để nàng, hắn, bọn chúng tôn sùng một cái.)"),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1361"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1363"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);